import React, { Component } from "react";
import { Input, Button } from "reactstrap";

class LogIn extends Component {
  render() {
    return (
      <div>
        <div>Youtube Cat</div>
        <Input placeholder="email" />
        <Input placeholder="password" />
        <Button outline color="primary">
          primary
        </Button>
      </div>
    );
  }
}

export default LogIn;
